def Z(z, z_prime, m, n, step):
    if z < z_prime:
        return (np.cosh(Beta(step, m, n) * z))*(np.sinh(Beta(step, m, n)*(L - z_prime)))/(np.sinh(Beta(step, m, n)*L))
    if z >= z_prime:
        return -(np.cosh(Beta(step, m, n)* (L - z)))*(np.sinh(Beta(step, m, n)*(z_prime)))//(np.sinh(Beta(step, m,n)*L))
    
def R(r, m, n, step):
    return sp.yv(m,a*Beta(step, m, n))*sp.jv(m,r*Beta(step, m, n)) - sp.jv(m,a*Beta(step, m, n))*sp.yv(m,r*Beta(step, m, n))

def N(m, n, step):
    return (2/((((np.pi)**2))*((Beta(step, m, n))**2)))*((((sp.jv(m, a*Beta(step, m, n)))**2)/(((sp.jv(m, b*Beta(step, m, n)))**2))) - 1)

def R_total(r, r_prime, m, n, step):
    return (R(r, m, n, step)*R(r_prime, m, n, step))/N(m, n, step)

def Phi(phi, phi_prime, m):
    return np.cos(m * (phi - phi_prime))

def Delta(m):
    if m == 0:
        return 1
    else:
        return 2

def Potential(r, phi, z, r_prime, phi_prime, z_prime, step, order):

    m = 0

    potential_array = np.zeros([order + 1, order])

    while m <= order:
        n = 1
        while n <= order:
            potential_array[m, n - 1] = (1/(2*(np.pi)))*Delta(m)*Phi(phi, phi_prime, m)*R_total(r, r_prime, m, n, step)*Z(z, z_prime, m, n, step)
            n += 1
        m += 1

    Potential = np.sum(potential_array)

    return Potential

def E_z(r, phi, z, r_prime, phi_prime, z_prime, step, order):

    m = 0

    E_z_array = np.zeros([order + 1, order])

    while m <= order:
        n = 1
        while n <= order:
            E_z_array[m, n - 1] = (-1/(2*(np.pi)))*Delta(m)*Phi(phi, phi_prime, m)*R_total(r, r_prime, m, n, step)*Z(z, z_prime, m, n, step)
            n += 1
        m += 1

    E_Z = np.sum(E_z_array)

    return E_Z

