badness_point = 70

def badness_function(step, order):
    error_peak = E_z(badness_point, phi_prime, z_prime, r_prime, phi_prime, z_prime, step, order)
    legit_peak = E_z(r_prime, phi_prime, z_prime, r_prime, phi_prime, z_prime, step, order)
    ratio = error_peak/legit_peak
    
    badness = np.log(np.abs(ratio))
    return badness

